    return (
        <>
            <br/>
            <br/>
            <br/>
            <br/>
            <br/>
            <br/>
            <form onSubmit="datasubmit()">
                <input type="text" name="username"/>
                <input type="file" onChange={this.fub.bind()}/>
                <input type="submit" value="save"/>
            </form>
        </>
    )
}

export default Form
